export class ToolOutput {
    content;
    toolName;
    rawInput;
    rawOutput;
    constructor(content, toolName, rawInput, rawOutput){
        this.content = content;
        this.toolName = toolName;
        this.rawInput = rawInput;
        this.rawOutput = rawOutput;
    }
    toString() {
        return this.content;
    }
}
